import styled from "@emotion/styled";

const Container = styled.div`
  height: 30rem;
  width: 100%;
  padding: 3rem;
  margin-bottom: 2rem;
`;

const ProductContainer = styled.div`
  display: grid;
  grid-template-areas:
    "bg bg . ."
    "bg bg . .";
`;

type Props = {
  title: String;
};

export const ProductSection = (props: Props) => {
  const { title = "ฝ้าเพดานหินอ่อน" } = props;
  return (
    <Container>
      <h2>{title}</h2>
      <ProductContainer></ProductContainer>
    </Container>
  );
};
